import React from "react";
import MapChart from "./MapChart";

import "./Map.css";

const MapPage = ({ setCurrChosen, currChosen, currMap }) => {
  const mapProps = {
    world: {
      scale: 170,
      center: [40, 40],
      rotate: [-10, 0, 0],
      coordinates: [0, 0],
      translateExtent: [
        [-100, -50],
        [860, 600],
      ],
      minZoom: 1,
      maxZoom: 6,
    },
    europe: {
      scale: 170,
      center: [40, 80],
      rotate: [-10, 0, 0],
      coordinates: [10, 50],
      //translateExtent goes [[left, up],[right,down]]
      translateExtent: [
        [300, -50],
        [460, 570],
      ],
      minZoom: 4.5,
      maxZoom: 8,
    },
  };

  return (
    <>
      <div className="map">
        <MapChart
          setCurrChosen={setCurrChosen}
          currChosen={currChosen}
          currMap={currMap}
          mapProps={mapProps[currMap]}
          // currLocation={props.currLocation}
        />
      </div>
    </>
  );
};

export default MapPage;
